import React, { useState, useEffect } from 'react'
import { NavLink } from 'react-router-dom'
import { Menu } from 'antd';
import store from "../redux/store"
import { createFetchMenu } from "../redux/count_aciton"
function Side() {
    const [current, setCurrent] = useState('mail');
    const onClick = (e) => {
        setCurrent(e.key)
    };
    useEffect(() => {
        console.log(current,'current');

        store.dispatch(createFetchMenu(current))
    }, [current]);
    return (

        <Menu
            onClick={onClick}
            style={{
                width: 200,
                height: '80vh',
            }}
            mode="inline"
            theme='dark'
        >
            <Menu.Item key='jobManagemen'>
                <NavLink to='/dashboard/jobManagemen'>作业管理</NavLink>
            </Menu.Item>
            <Menu.Item key='explorationProject'>
                <NavLink end to='/dashboard/explorationProject'>勘探项目</NavLink>
            </Menu.Item>
        </Menu>
    )
}
export default Side
